    [],nt"revision_timestamp": "2016-01-16T09:48:21.776355",nt"name": "precious-coral-logbook-data-set",nt"isopen":
    false,nt"url": null,nt"notes": "This is a federally mandated logbook program
    for harvesting precious coral, and it is required to be mailed in to PIFSC after
    a fishing trip. Data is from 1999-2000. This logbook may be being replaced in 2012
    by the Western Pacific Precious Coral Daily Harvest Log.nnCatch and effort data
    are collected by species.  Species covered are commercial species of black coral
    and all commercial deepwater species of precious coral (pink, gold, bamboo). There
    is also a section for recording Protected Species interactions.     nnGeographic
    area for the data - all jurisdictions where permit is valid.nnStart and end years
    for the data collected - ask Nate for first year data collected.  Data collection
    is ongoing as long as there are permits out there.  n",nt"license_title": null,nt"extras":
